import React, { Component } from "react";

class Movie extends Component {
  render() {
    let { title, genre, numberInStock, dailyRentalRate } = this.props.movie;
    console.log(title);

    return (
      <tr>
        <th scope="row">{title}</th>
        <td>{genre}</td>
        <td>{numberInStock}</td>
        <td>{dailyRentalRate}</td>
      </tr>
    );
  }
}

export default Movie;
